import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

// Pre-login Components
import Login from "./PreLogin/Login";
import Register from "./PreLogin/Register";
import Home from "./PreLogin/Home";


// Post-login Components (after successful login)
import Navbar from "./pages/Navbar";
import AdminDashboard from "./components/AdminDashboard";
import UserDashboard from "./components/UserDashBoard";
import ListMedicines from "./pages/listMedicine";
import AddEditMedicine from "./pages/AddEditMedicine";
import AllUsers from "./pages/AllUsers";
import Cart from "./pages/cart";
import UserProductViews from "./Userpage/userproductviews";
import ChangePassword from "./Userpage/Changepassword";

// Component to manage Navbar visibility based on the current route
function MedicalStoreApp() {
  return (
    <div className="App">
      <Router>
        <Routes>
          {/* Pre-login Routes */}
          <Route element={<PreLoginLayout />}>
            <Route path="/" element={<Home />} />
            <Route path="login" element={<Login />} />
            <Route path="register" element={<Register />} />
          </Route>

          {/* Post-login Routes (with Navbar) */}
          <Route element={<Navbar />}>
            <Route path="/admin/dashboard" element={<AdminDashboard />} />
            <Route path="/User/dashboard" element={<UserDashboard />} />
            <Route path="/md/Medicines" element={<ListMedicines />} />
            <Route path="/ad/AddEditMedicine" element={<AddEditMedicine />} />
            <Route path="/User" element={<AllUsers />} />
            <Route path="/Cart" element={<Cart />} />
            <Route path="/UserProductViews" element={<UserProductViews />} />
            <Route path="/ChangePassword" element={<ChangePassword />} />
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default MedicalStoreApp;
